CREATE TABLE IF NOT EXISTS `aabbcc`(`id` int(10) NOT NULL auto_increment,  `ab` datetime NOT NULL,  `cd` varchar(255) NOT NULL,  `ef` tinyint NOT NULL,  `gh` int(11) NOT NULL,  `ij` varchar(255) NOT NULL,  `created_id` int NULL,  `created_at` datetime NULL,  `updated_id` int NULL,  `updated_at` timestamp,PRIMARY KEY(`id`));